import React from 'react';
import { List } from 'antd';

class ListUsers extends React.Component {
  constructor(props) {
    super(props)
    object = this.state
    this.setState({
      title: this.props.title,
      color: this.props.color,
      id: this.props.id,
    });
  }

  state = {
    data: [],
    color: [],
    id: [],
  }



  booking = (id) => {
    console.log(id)
  }

  noBooking = () => {}



  render() {
    return (
      <>
        <List
          dataSource={object}
          renderItem={item => (
            <List.Item>
              <a style={{color: `${object.color}`}} onClick={this.booking(item[0])} id={item[0]}>{object.id}</a>
            </List.Item>
          )}
        />
      </>
    )
  }
}

export default ListUsers;
